import Home from './components/Home';
import './App.css';
import Navbar from './components/Navbar';
import Resume from './components/Resume';

function App() {
  const style = {
    backgroundColor: '#E3F5FBDA',
    minHeight: '100vh',
  }
  return (
    <>
      <div style={style}>
        <Navbar />
        <Resume />
        {/* <Home /> */}

      </div>
    </>
  );
}

export default App;
